import React from 'react';
import styles from './Contacts.module.css';

function Contacts() {
    return (
        <div className={styles.skill}>
            <div className={styles.conteiner}>
                <h2>Контакты</h2>
                <form className={styles.form}>
                    <input className='text_contact' type='text' placeholder='Name'/>
                    <input className='text_contact' type='text' placeholder='e-mail'/>
                    <textarea className='text_contact' type='text' placeholder='Message'></textarea>
                </form>
                <button className={styles.btn}>Отправить</button>
            </div>
        </div>
    );
}

export default Contacts;
